      <GridItem xs={12} sm={12} md={12}>
        <Card plain>
          <CardHeader plain color="info">
          <h4 className={classes.cardTitleWhite}> ALL My Available Classes </h4> 
           {/* <p className={classes.cardCategoryWhite}></p>  */}

          </CardHeader>
          <CardBody>
          <GridContainer>
      <GridItem xs={12} sm={12} md={12}>
        <Card >
        </Card>
        </GridItem>
        </GridContainer>

          </CardBody>
        </Card>
      </GridItem>
    </GridContainer>
  );}
}

Icons.propTypes = {
  classes: PropTypes.object.isRequired
};

export default withStyles(iconsStyle)(Icons);
